import React from "react";
import "../styles/sidebar.css";

const Sidebar = () => {
  return (
    <div className="sidebar sidebar-title">
      <span id="sidebar-name">Garret{"\n"}Sweetwood</span>Full Stack Developer
    </div>
  );
};

export default Sidebar;
